        browser.url('');
        NavSection.signIn()
        CreateAccount.createEmail();
        CreateAccount.submitCreate();
        expect(CreateAccount.monthOfBirthField.getText().replace(/\s/g,'')).toEqual('-JanuaryFebruaryMarchAprilMayJuneJulyAugustSeptemberOctoberNovemberDecember')
    })

