        NavSection.signIn();
        CreateAccount.createEmail();
        CreateAccount.submitCreate();
        CreateAccount.completeRequiredFields('abcde', 'qwe', 'abc111', 'Bbbb 1234', 'Rosario', 'Alabama', '11111', 'United States', '123456');
